import React, { useState, useEffect } from 'react';
import { FaCalendarAlt, FaBell, FaRedoAlt, FaStar } from 'react-icons/fa';
import { fetchWeather } from '../services/weatherService';
import './ToDoPage.css'; // Import the CSS file

const ToDoPage = () => {
  const [tasks, setTasks] = useState([]);
  const [task, setTask] = useState('');
  const [priority, setPriority] = useState('Medium');
  const [notification, setNotification] = useState('');
  const [repeat, setRepeat] = useState('None');
  const [dueDate, setDueDate] = useState('');
  const [weather, setWeather] = useState(null);
  const [location, setLocation] = useState('New York');

  useEffect(() => {
    const storedTasks = JSON.parse(localStorage.getItem('tasks')) || [];
    setTasks(storedTasks);
  }, []);

  useEffect(() => {
    localStorage.setItem('tasks', JSON.stringify(tasks));
  }, [tasks]);

  const addTask = (e) => {
    e.preventDefault();
    if (task.trim()) {
      setTasks([...tasks, { text: task, priority, dueDate, repeat, notification }]);
      setTask('');
      setPriority('Medium');
      setDueDate('');
      setRepeat('None');
      setNotification('');
    }
  };

  const deleteTask = (index) => {
    setTasks(tasks.filter((_, i) => i !== index));
  };

  const completedTasks = tasks.filter(task => task.completed).length;
  const totalTasks = tasks.length;

  return (
    <div className="todo-page-container">
      {/* Sidebar */}
      <aside className="sidebar">
        <div className="profile-section">
          <img src="profile-picture.jpg" alt="Profile" className="profile-pic" />
          <h3>Hey, ABCD</h3>
        </div>
        <nav className="sidebar-nav">
          <ul>
            <li>All Tasks</li>
            <li className="active">Today</li>
            <li>Important</li>
            <li>Planned</li>
            <li>Assigned to me</li>
          </ul>
        </nav>
        <div className="task-summary">
          <h4>Today Tasks: {totalTasks}</h4>
          <div className="progress-circle">
            <svg>
              <circle cx="50" cy="50" r="40"></circle>
            </svg>
            <span>{((completedTasks / totalTasks) * 100).toFixed(0)}%</span>
          </div>
        </div>
      </aside>

      {/* Main Content */}
      <main className="main-content">
        <h2>To-Do List</h2>
        <form onSubmit={addTask} className="add-task-form">
          <input
            type="text"
            value={task}
            onChange={(e) => setTask(e.target.value)}
            placeholder="Add a new task"
          />
          <button type="submit">Add Task</button>
        </form>

        <ul className="task-list">
          {tasks.map((task, index) => (
            <li key={index} className="task-item">
              <input type="checkbox" />
              <span>{task.text}</span>
              <FaStar className="star-icon" />
              <button onClick={() => deleteTask(index)} className="delete-btn">Delete</button>
            </li>
          ))}
        </ul>
      </main>
    </div>
  );
};

export default ToDoPage;
